import './App.css';

function App() {
  return (
    <div className="App">
      <div className="information">
        <label>Exercise:</label>
        <input type="text"/>
        <label>No. of Sets:</label>
        <input type="number"/>
        <label>Rep Break Down:</label>
        <input type ="text"/>
        <label>Weight Breakdown</label>
        <input type = "text" />
      </div>

    </div>
  );
}

export default App;
